                    "id": "fd25be31-8cee-4dde-ae8a-c8d7534daef1",
                    "text": "跟对面学学啊，看人家团的多好！",
                    "path": "0d6a65ef-ebd4-49f0-9bab-cb29fa4fc289/fe2c95a4-cdb0-435d-a719-481d03d9041d/5701cdc7-7c32-4b2c-a516-b19e8c43d0fc/59a46b65-9af4-4b33-8139-ee295f322b43/fd25be31-8cee-4dde-ae8a-c8d7534daef1",
                    "priority": 0
