                    "id": "ab9605cf-6625-494b-a104-84a72bce9694",
                    "text": "你不团真想让对面团战灭了你！",
                    "path": "0d6a65ef-ebd4-49f0-9bab-cb29fa4fc289/fe2c95a4-cdb0-435d-a719-481d03d9041d/5701cdc7-7c32-4b2c-a516-b19e8c43d0fc/59a46b65-9af4-4b33-8139-ee295f322b43/ab9605cf-6625-494b-a104-84a72bce9694",
